import * as React from 'react';

interface Props {
    name: string
}

const myStyle = {
    marginBottom: '15px',
    margin: '0px',
    width: '225px',
    height: '100',
    display: 'flex',
    justifyContent: 'left',
    alignItems: 'center'
    // fontWidth: 'bold',
    // fontWeight: 9000,

}

export const NavBarListElement: React.FC<Props> = ({name}) => {
    return (
        <div>
            <button style={myStyle}>
                {name}
            </button>
        </div>
    );
}
